import React from "react";
import "./App.css";

function Info(props) {
  console.log(props);
  return (
    <div className="youtube__item">
      <img src={props.src} alt="" className="header__img" />
      <h1 className="header__title">{props.title}</h1>
      <div className="info">
        <img src={props.user} alt="" className="user" />
        <div className="post">
        <p c></p>
          <p className="header__desc">{props.desc}</p>
        </div>
      </div>
    </div>
  );
}

const Test = () => {
  return (
    <div className="youtube__list">
      <Info
        title="Trung Duong"
        src="https://plus.unsplash.com/premium_photo-1703631159581-36fe0174e4e6?w=500&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxlZGl0b3JpYWwtZmVlZHw3fHx8ZW58MHx8fHx8"
        alt=""
        className="header__img"
        user="https://images.unsplash.com/photo-1480429370139-e0132c086e2a?q=80&w=1976&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
        desc="Trung Duong"
      ></Info>
    </div>
  );
};

export default Test;
